const LandingPage = () => {

    const userDatabackend = localStorage.getItem('userData');  
    const userDatamatch = userDatabackend ?  JSON.parse(userDatabackend) : null;
    console.log(userDatamatch.firstName)

    return(
        <>
      <div className="profile-content">
        <h2>My Profile</h2>
        <div className="profile-card">
          <img src="path/to/avatar.png" alt="Profile" className="avatar" />
          <h3>Edit Photo</h3>
          <p>Krishna</p>
          <p>{initialValues.username}</p>
          <p>{initialValues.department}</p>
          <Formik
            initialValues={initialValues}
            validationSchema={validationSchema}
            onSubmit={(values) => {
              console.log('Form Values:', values);
            }}
          >
            {({ errors, touched }) => (
              <Form className="form-section">
                <div>
                  <label htmlFor="phone">Phone</label>
                  <Field name="phone" type="text" />
                  {errors.phone && touched.phone ? (
                    <div className="error">{errors.phone}</div>
                  ) : null}
                </div>
                <button type="submit">Edit</button>
              </Form>
            )}
          </Formik>
        </div>
        </div>
        </>
    )
}


export default LandingPage;
